import React from 'react';
import BlogData from './data.json';
import { NavLink } from 'react-router-dom';

function Category() {
  const CtPost = BlogData.data;
  return (
    <div>
      {CtPost.map((post) => {
        return (
          <NavLink to={`/$(CtPost.id)`}>
            <div>
              <h1>{post.blogTitle}</h1>
              <p>{post.postedOn}</p>
            </div>
          </NavLink>
        );
      })}
    </div>
  );
}

export default Category;
